svg.script:
var Selected='Splash';
var ToFind='';
var History=new Array("","","","","");
var NodeList;
var SelectedNode=null;
var CorrectNode=null;
var Feedback;
var Score=0;
var TopScore=0;

function loaded() {
  // change onloadFunc to point to your real onload function that you
  // want called when the page is truly ready
  var onloadFunc = Init;

  if (top.svgweb != undefined) {
    top.svgweb.addOnLoad(onloadFunc, true, window);
  } else {
    onloadFunc();
  }
}

function Init()
  {
    NodeList=document.getElementsByTagName('path');
    Feedback=document.getElementById('Feedback').firstChild;
    ScoreBoard=document.getElementById('Score').firstChild;
    TopScoreBoard=document.getElementById('TopScore').firstChild;
  }

function BgnClick()
  {
    var a=document.getElementById('Splash');
    a.parentNode.removeChild(a);
    Selected='none';
    NewNode();
    ScoreBoard.nodeValue='Score: 0';
    TopScoreBoard.nodeValue='Top Score: 0';
  }

function BgnOn() 
  {
    var a=document.getElementById('BgnText');
    a.setAttribute('fill','#f66');
  }

function BgnOff() 
  {
    var a=document.getElementById('BgnText');
    a.setAttribute('fill','#66f');
  }

function NewNode()
  {
//    var a=Math.round(Math.random()*NodeList.length);
    var a=Math.round(Math.random()*49);

// Store last 5 Nodes in History array, use to ensure that the same
// Node isn't randomly chosen again for the next 5 turns
    var HistoryString=History.toString();
    while(HistoryString.indexOf(NodeList.item(a).id)!=-1)
      { 
        a++; 
        if(a==50)
          a=1;
      }

    ToFind=NodeList.item(a).id;

    Feedback.nodeValue='Find '+ToFind;
    History.pop();
    History.unshift(ToFind);
  }

function UpdateScore() 
  {
    if(Score>TopScore)
      {
        TopScore=Score;
        TopScoreBoard.nodeValue='Top Score: '+TopScore;
      }
    Score=0;
    ScoreBoard.nodeValue='Score: 0';
    if(SelectedNode)
      {
        SelectedNode.setAttribute('fill','#ccc');
        SelectedNode=null;
      }
    if(CorrectNode)
      {
        CorrectNode.setAttribute('fill','#ccc');
        CorrectNode=null;
      }
    NewNode();
    Selected='none';
  }

function Check(a) 
  {
    if(Selected!='Splash')
      {
        if(a.target.id==ToFind)
          {
            Feedback.nodeValue='Correct!';
            Score++;
            ScoreBoard.nodeValue='Score: '+Score;
            window.setTimeout("NewNode(); Selected='none';", 1000);
          }
        else
          {
            SelectedNode=a.target;
            Selected=a.target.id;
            CorrectNode=document.getElementById(ToFind);
            CorrectNode.setAttribute('fill','#6c6'); // highlight correct answer        
            Feedback.nodeValue='Wrong. You selected '+Selected;

            window.setTimeout("UpdateScore()", 2000);
          }
      }
  }

function On(a) 
  {
    if(Selected=='none')
      a.target.setAttribute('fill','#f66');
  }

function Off(a) 
  {
    if(a.target.id!=Selected)
      a.target.setAttribute('fill','#ccc');
  }
